import React, { Component } from 'react';

export default class SpellCard extends Component{
    render() {
        let {name, category, effect} = this.props.spell
        return (
            <div>
                <table class="ui selectable inverted table">
                <thead>
                    <tr>
                    <th>Name</th>
                    <th>Category</th>
                    <th class="right aligned">Effect</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                    <td>{name}</td>
                    <td>{category}</td>
                    <td >{effect}</td>
                    </tr>
                </tbody>
                </table>
            </div>
        );
    }
}
